package easy;

import java.util.HashMap;

/**
 * Given two strings s and t, return true if t is an anagram of s, and false otherwise.
 * An Anagram is a word or phrase formed by rearranging the letters of a different word or phrase, typically using all the original letters exactly once.
 */
/*
Runtime 12 ms Beats 55.18%
Memory 42.9 MB Beats 82.72%
 */
public class ValidAnagram242 {

    public static void main(String[] args) {
        String s = "";
        String t = "";
        System.out.printf("is anagram? %b", isAnagram(s, t));
    }

    public static boolean isAnagram(String s, String t) {
        if (s.length() != t.length()) return false;
        HashMap<Character, Integer> sMap = getCountMap(s);
        HashMap<Character, Integer> tMap = getCountMap(t);
        for (char r : sMap.keySet()) {
            if (!tMap.containsKey(r) || (( sMap.get(r)) != (int) tMap.get(r))) return false;
        }
        return true;
    }

    public static HashMap<Character, Integer> getCountMap(String s) {

        HashMap<Character, Integer> map = new HashMap<>();
        for (Character c : s.toCharArray()) {

            if (map.containsKey(c)) {
                map.put(c, (map.get(c) + 1));
            } else {
                map.put(c, 1);
            }
        }
        return map;
    }


}
